In terms of fastest way to iterate over tensor data, below are the results for some basic trials. Between the 5 different options below, options **1 and 2**  had similar latency of ~**150ms**. Option **3** took **~5200 ms**  while option **4** was  **~6300ms**, and option **5** around  **~5600 ms**. 

Options **1 and 2** seem to be the best choices at this time. 

Not sure why options **3 and 4** differ in performance, if the returned object is already a DenseTensor and the extra cast should not result in a copy (from what you mentioned above), so we should expect these two options to have similar performance. 

Option **5**, using the pin() method + unsafe pointer operations after casting to DenseTensor was slightly better than option **4**, but worse than option **3**.  One explanation could be that the the cast to DenseTensor **does** involve some overhead, but then the pointer arithmetic is faster than iterating/indexing over Tensor objects, which would explain why this faster than **4**, but slower than **3**.

