In terms of performance enhancement, the **System.Numerics.Tensor** class is a fundamental type in the OnnxRuntime C# library, so it  cannot be removed easily. The fastest way to access  data seems to be via the AsArray() methods at this time.

Regarding the other related issue #713, not being able to access large tensor output (>2G), I was able to construct an model output tensor of 1 Billion floats (size=4G ), and access the values via options **1 and 2** above in about **2817 ms**. Option **5** + unsafe pointer operations, also worked successfully, but took  longer at around **52290 ms**.  It seems like the cast  to DenseTensor is taking cycles , but there was no exception processing a large output tensor.

For the exception for large output tensor, please attach/forward a minimal example to reproduce the crash, since it cannot be reproduced using the test mentioned above.
